  [],\n\t\"revision_timestamp\": \"2015-05-06T21:39:39.822548\",\n\t\"name\": \"single-frequency-lasers-for-space-based-wind-and-aerosol-lidar-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"This SBIR will develop single frequency
  cw laser technology for 2um lidar and UV interferometer locking control critical
  to NASA missions that will measure atmospheric winds and aerosols. NASA recently
  completed the Earth Science Decadal Study that identified atmospheric global wind
  and aerosol measurement as high priority missions with recommended satellite deployments
  within the next decade. Our general approach to this SBIR is to perform proof of
  concept research that results in optical designs that can be readily integrated
  into existing flight ready hardware. After Phase 2 we anticipate the technology
  will readily transfer to NASA mission use. We expect successful completion of the
  proposed work to increase the TRL from 4 to 5.  rnrnThe innovation of this SBIR
  is the development of space-qualifiable CW single-frequency lasers at 2 5m and 355
  nm, products that are not commercially available. Numerous pulsed 355 nm sources
  are available for commercial applications but they are not space-qualifiable. There
  are several scientific investigations of 355 nm CW lasers described in the literature
  but no effort has been made to create high vibration aircraft nor space qualified
  products available to NASA. rn\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
